import Bio from './components/Bio.js'
import Julkaisut from './components/Julkaisut.js'
import Keikat from './components/Keikat.js'

import SplashScreen from './components/SplashScreen.js'

function App() {
  return (
    <div className="App">
      <SplashScreen/>
      <div className="content">
        <Bio/>
        <Julkaisut/>
        <Keikat/>
      </div>
    </div>
  );
}

export default App;
